import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('domcontentloaded');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click the first category card
    await page.waitForSelector('.category-card', { timeout: 5000 });
    await page.click('.category-card:first-child');

    // Wait for product cards to load and add multiple items to cart rapidly
    await page.waitForSelector('.product-card', { timeout: 5000 });
    const addButtons = await page.$$('.add-to-cart:not([disabled])');

    for (let i = 0; i < Math.min(3, addButtons.length); i++) {
      await addButtons[i].click();
      await page.waitForTimeout(100); // Small delay between rapid additions
    }

    // Take screenshot after adding items
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_add.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_add.png'));

    // Open cart modal
    await page.click('.cart');
    await page.waitForSelector('#cartModal', { timeout: 5000 });

    // Remove all items from cart rapidly
    const removeButtons = await page.$$('.remove-item');
    for (const button of removeButtons) {
      await button.click();
      await page.waitForTimeout(100); // Small delay between rapid removals
    }

    // Wait for empty cart state and take final screenshot
    await page.waitForSelector('.empty-cart', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_empty_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_empty_cart.png'));

    // Close cart modal
    await page.click('body');

    return {
      success: true,
      action: "Performed rapid cart stress test: added and removed multiple items",
      extractedData: {
        itemsAdded: Math.min(3, addButtons.length),
        itemsRemoved: removeButtons.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete rapid cart stress test",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
